package redis4rag

import (
	"cmp"
	"context"
	"errors"
	"os"
	"testing"
	"time"

	"github.com/redis/go-redis/v9"

	should "github.com/stretchr/testify/assert"
)

func TestRetrievalBasic(t *testing.T) {
	indexname := "idx:test_retrieval_basic"
	docprefix := "doc:test_retrieval_basic"

	retriever := &Retriever{
		IndexName: indexname,
		DocPrefix: docprefix,
		RedisCli: redis.NewClient(&redis.Options{
			Addr:     cmp.Or(os.Getenv("REDIS_URL"), "localhost:6379"),
			Protocol: 2,
		}),
	}

	retriever.RedisCli.FTDropIndexWithArgs(context.Background(), indexname, &redis.FTDropIndexOptions{DeleteDocs: true}).Result()

	err := createIndex(retriever.RedisCli, indexname, docprefix)
	should.Nil(t, err)
	t.Log("index created")

	docs := []*Document{
		{Tag: "chatter", ID: "0", Content: "咱俩谁跟谁呀。", Payload: "k1:v1;k2:v2"},
		{Tag: "chatter", ID: "1", Content: "我俩谁跟谁呀。"},
		{Tag: "joker", ID: "2", Content: "咱俩关系不错呀。", Payload: "k1:v1;k2:v2"},
		{Tag: "chatter", ID: "3", Content: "咱俩关系很好。", Payload: "k1:v1;k2:v2"},
	}
	for _, doc := range docs {
		err = retriever.Store(context.Background(), doc, localEmbedder.Embedding)
		should.Nil(t, err)
	}
	should.Nil(t, err)
	t.Log("document added")

	time.Sleep(100 * time.Millisecond)

	{
		docs, err := retriever.Retrieve(context.Background(),
			"咱俩谁跟谁呀。", "chatter,joker", 3, localEmbedder.Embedding)
		should.Nil(t, err)
		should.Equal(t, 3, len(docs))
		should.Equal(t, "0", docs[0].ID)
		should.Equal(t, "1", docs[1].ID)
		should.Equal(t, "2", docs[2].ID)
	}

	{
		docs, err := retriever.Retrieve(context.Background(),
			"咱俩谁跟谁呀。", "chatter", 3, localEmbedder.Embedding)
		should.Nil(t, err)
		should.Equal(t, 3, len(docs))
		should.Equal(t, "0", docs[0].ID)
		should.Equal(t, "1", docs[1].ID)
		should.Equal(t, "3", docs[2].ID)
	}

	_, err = retriever.RedisCli.FTDropIndexWithArgs(context.Background(), indexname, &redis.FTDropIndexOptions{DeleteDocs: true}).Result()
	should.Nil(t, err)
	t.Log("index dropped")
}

func createIndex(cli *redis.Client, indexName string, docPrefix string) (err error) {
	cmd := cli.FTCreate(context.Background(), indexName,
		&redis.FTCreateOptions{Prefix: []interface{}{docPrefix}, OnJSON: true},
		Schema...)
	_, err = cmd.Result()
	if err != nil {
		return err
	}
	for {
		var res redis.FTInfoResult
		res, err = cli.FTInfo(context.Background(), indexName).Result()
		if err != nil {
			return err
		}
		if res.Indexing == 0 {
			return
		}
		time.Sleep(100 * time.Millisecond)
	}
}

type str2vec map[string][]float64

func (s2v str2vec) Embedding(_ context.Context, text string) (vec []float64, err error) {
	var exist bool
	if vec, exist = s2v[text]; !exist {
		err = errors.New("not exist")
	}
	return
}

